        res.status(404).send({msg: "Product Not Found."});
});

app.get("/api/products", (req, res) => {
    res.send([data.milktea, data.coffee, data.soda, data.juice, data.food]);
});

app.listen(5000, () => {console.log("Server started at http://localhost:5000")});

