import express from 'express';
import expressAsyncHandler from 'express-async-handler';
import Order from '../model/orderModel.js';
import {isAuth, isStaff} from '../ultil.js'

const orderRouter = express.Router();
orderRouter.get('/mine', isAuth, expressAsyncHandler(async(req, res) => {
    const orders = await Order.find({user: req.user._id});
    res.send(orders);
}))
orderRouter.get('/staff', isAuth, isStaff, expressAsyncHandler(async(req, res) => {
    const orders = await Order.find({});
    res.send(orders);
}))
orderRouter.post(
    '/',
    isAuth,
    expressAsyncHandler(async (req,res) => {
        if(req.body.orderItems.length === 0) {
            res.status(400).send({message: 'Cart is empty'});
        }
        else {
            const order = new Order({
                orderItems: req.body.orderItems,
                shippingAddress: req.body.shippingAddress,
                paymentMethod: req.body.paymentMethod,
                itemsPrice: req.body.itemsPrice,
                shippingPrice: req.body.shippingPrice,
                taxPrice: req.body.taxPrice,
                totalPrice: req.body.totalPrice,
                user: req.user._id
            });
            const createdOrder = await order.save();
            res.status(201).send({message: 'New Order Created', order: createdOrder});
        }
    })
);
orderRouter.delete(
    '/',
    isAuth,
    isStaff,
    expressAsyncHandler(async (req,res) => {
        const order = await Order.findByIdAndRemove(req.body._id);
        if (order) {
            res.send('Order Deleted');
        } else {
            res.status(404).send({message: 'Order Not Found'});
        }
    }
));

orderRouter.get (
    '/:id', 
    isAuth, 
    expressAsyncHandler(async(req, res) => {
        const order = await Order.findById(req.params.id);
        if (order) {
            res.send(order);
        } else {
            res.status(404).send({message: 'Order Not Found'});
        }
    })
);

orderRouter.put (
    "/:id/pay",
    isAuth,
    expressAsyncHandler(async (req, res) => {
        const order = await Order.findById(req.params.id);
        if (order) {
            order.isPaid = true;
            order.paidAt = Date.now();
            order.paymentResult = {id: req.body.id, status: req.body.status, update_time: req.body.update_time, email_address: req.body.email_address};
            const updatedOrder = await order.save();
            res.send({message:'Order Paid', order: updatedOrder}); 
        } else {
            res.send(404).send({message: "Order not found"});
        }
    })
)
orderRouter.put (
    "/:id/deliver",
    isAuth,
    isStaff,
    expressAsyncHandler(async (req, res) => {
        const order = await Order.findById(req.params.id);
        if (order) {
            order.isDelivered = true;
            order.deliveredAt = Date.now();
            const updatedOrder = await order.save();
            res.send({message:'Order Delivered', order: updatedOrder}); 
        } else {
            res.send(404).send({message: "Order not found"});
        }
    })
)
export default orderRouter;

